import React from 'react';
import './CalendarGrid.css';

export const CalendarGrid = () => {
    const totalDay = 42;
    const daysArray = [...Array(42)];
    return (
        <div className='gridWrapper'>
            {
                daysArray.map((_, i) => (
                    <div className='cellWrapper'>
                        <div className='rowInCell'>
                            <div className='dayWrapper'>
                                {i}
                            </div>
                        </div>
                    </div>
                ))
            }
        </div>
    )
}
